section.p:
С неприятной угрозой f2—f4, против которой, увы нет лекарства; 
                29. ... Kpf7 невозможно из-за 30. Л:g5. Поэтому черные пускаются на 
                отчаянную ловушку.

2) не только открывает слону диагональ с8—h3 и в дальнейшем 
                (после 10. d5 Kd8 11. h3 Kh5! и т. д.) вскрывает линию "f", но и 
                вообще превращает всю партию в открытую игру;

Излюбленная и логически обоснованная атака на краеугольное поле d4; 
                однако белые, именно вследствие их 5-го хода, относятся к ней вполне 
                спокойно.
